/*!50003 CREATE*/ /*!50017 DEFINER=`HP4420S`@`%`*/ /*!50003 TRIGGER `tg_IntegrarVentas` AFTER INSERT ON `vymsa2020`.`fctpdt` FOR EACH ROW BEGIN
    
   
   # Declaracin de Variables
    DECLARE CuentaContable, CuentaCliente CHAR(30);
    DECLARE CodigoTrans,Doc,Doc2,Doc3 CHAR(2);
    DECLARE Detalle, Detalle1 CHAR(80);
    DECLARE BodFacTip1 CHAR(23);
    DECLARE Valor DECIMAL(18,4);
    DECLARE NomForPago CHAR(15);
    DECLARE CodGru CHAR(5);
    DECLARE TipoP,clitipo CHAR(1);
    
    
       # Variables Globales
     IF (NEW.pdttd='F' OR NEW.pdttd='P' OR NEW.pdttd='L') THEN
    SELECT CONCAT("VENTA FACTURA/NOTA VENTA No. ",NEW.pdtfactura," FECHA ",NEW.pdtfechaf,"/",NEW.pdtfechav) INTO Detalle1 ; 
    ELSE
    SELECT CONCAT("NOTA DE CREDITO No. ",NEW.pdtfactura," FECHA ",NEW.pdtfechaf,"/",NEW.pdtfechav) INTO Detalle1 ; 
    END IF ;
    IF (NEW.pdttd='F') THEN
	SELECT prmtrx_fc INTO Doc FROM fctprm ;
    END IF ;
    		
    IF (NEW.pdttd='P') THEN
	SELECT prmtrx_fc1 INTO Doc FROM fctprm ;
    END IF ;
    IF (NEW.pdttd='N') THEN
	SELECT prmtrx_rc INTO Doc FROM fctprm ;
    END IF ;
    IF (NEW.pdttd='L') THEN
	SET Doc = 'EN';
    END IF ;
   
    SELECT prmtrx_fc2 INTO Doc2 FROM fctprm ;
    SELECT prmtrx_fc3 INTO Doc3 FROM fctprm ;
    SELECT dircuenta,dirgrupo,dirtipo INTO CuentaCliente,CodGru,clitipo FROM cpcdir WHERE (dirclave=NEW.pdtclave);
 
    IF(NEW.forma1 <>' ') THEN
    
	SET CuentaContable = fn_FacVerificarCreOCont(NEW.forma1,NEW.bodegafc,new.pdtserie1,new.pdtserie2,new.pdtcuenta);
	SELECT pagtipo2 INTO CodigoTrans FROM tespago WHERE(pagocod=NEW.forma1);
	SELECT pagonom INTO Detalle FROM tespago WHERE(pagocod=NEW.forma1);
	
	SELECT pagtip1 INTO NomForPago FROM tespago WHERE (pagocod=NEW.forma1);
	
	SELECT pagtipo INTO TipoP FROM tespago WHERE (pagocod=NEW.forma1);
	
	# ASIENTO CONTABILIDAD 
	
	INSERT INTO conhis
	VALUES(
	null,
        CuentaContable,
	NEW.pdtact,
	NEW.pdtcdc,
	NEW.pdtcodmon,
	'',
	Doc,
	NEW.pdtfactura,
	Detalle,
	IF (NEW.pdttd='N',ROUND(ROUND(-NEW.valor1,3),2),ROUND(ROUND(NEW.valor1,3),2)),
	CodigoTrans, 
	NEW.pdtcomp,
	NEW.pdtfechaf,
	NEW.pdtclave,
	NEW.pdtclave1,
	NEW.pdtzona,
	NEW.pdtfechaf,
	NEW.pdtfechav,
	0,
	0,
	0,
	0,
	NEW.pdtfactura,
	NEW.pdtnombre,
	NEW.pdtruc1,
	'',
	'',
	'',
	NEW.bodegafc,
	0,
	0,
	0,
	0,
	0,
	0,
	0,
	0,
	'',
	NEW.pdttd,
	NEW.pdtcomp,
	Detalle1,
	'',
	'',
	'',
	NEW.pdtno_form,
	NEW.pdtusui,
	NEW.pdtfbioi,
	NEW.pdtusum,
	NEW.pdtfbiom,
	4,
	NEW.panno,
	NEW.pdtcierra
	);
	
	# ASIENTO CLIENTES 
	IF ((NomForPago='CONTADO' OR NomForPago='TARJETA CREDITO') AND TipoP='I' ) THEN
		INSERT INTO cpchis
		VALUES(
